tables.table_schema:
CREATE TABLE resource_utilization (
  resource_id INT PRIMARY KEY,
  resource_name VARCHAR(255),
  utilization_percentage FLOAT,
  efficiency_metric FLOAT
);

CREATE TABLE performance_analysis (
  analysis_id INT PRIMARY KEY,
  resource_id INT,
  date DATE,
  performance_score FLOAT
);

CREATE TABLE resource_mapping (
    id SERIAL PRIMARY KEY,
    resource_id INT NOT NULL,
    resource_name VARCHAR(100) NOT NULL,
    owner VARCHAR(100) NOT NULL
);

CREATE TABLE efficiency_trends (
    id SERIAL PRIMARY KEY,
    trend_date DATE NOT NULL,
    trend_metric_name VARCHAR(100) NOT NULL,
    trend_value FLOAT NOT NULL
);

CREATE TABLE Users (
    id INT PRIMARY KEY,
    username VARCHAR(255),
    email VARCHAR(255),
    role VARCHAR(255)
);
